import './App.scss';
import WeitherCard from './components/weitherCard';


function App() {
  let days = [
    {
      temp : '25C',
      weither : 'Morning'
    },
    {
      temp : '10C',
      weither : 'Night'
    },
    {
      temp : '5C',
      weither : 'Evening'
    },
    {
      temp : '15C',
      weither : 'Morning'
    },
    {
      temp : '29C',
      weither : 'Evening'
    },
  ]

  return (
    <div className="App">
      {days.map((data) => console.log(data), <WeitherCard />)}
    </div>
  );
}

export default App;
